import React from 'react';
import { Link } from 'react-router-dom';

function ProfileButton() {
  return (
    <Link to="/profile" className="btn btn-outline-success w-100" style={{ fontWeight: 600 }}>
      My Profile
    </Link>
  );
}

export default ProfileButton;
